import React, { useState } from "react";
import "./App.css";
import image from "./image.webp";

function App() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const closeMenu = () => {
    setIsMenuOpen(false);
  };

  return (
    <div className="">
      <div class="text-container">
        <h1>Urgenism</h1>
      </div>

      <div class={`navbar-area ${isMenuOpen ? "open" : ""}`}>
        <div class="container">
          <nav class="site-navbar">
            <a href="#home" class="site-logo">
              logo
            </a>

            {/* site menu/nav */}
            <ul onClick={closeMenu}>
              <li>
                <a href="#">home</a>
              </li>
              <li>
                <a href="#">about</a>
              </li>
              <li>
                <a href="#">service</a>
              </li>
              <li>
                <a href="#">contact</a>
              </li>
            </ul>

            {/* nav-toggler for mobile version only */}
            <button class="nav-toggler" onClick={toggleMenu}>
              <span></span>
            </button>
          </nav>
        </div>
      </div>
    </div>
  );
}

export default App;
